CREATE DEFINER=`dbmasteruser`@`%` PROCEDURE `getClientsSessions`(IN indexIn int)
BEGIN
  SELECT 
  ClientsSessions.SessionIndex, ROW_NUMBER() OVER (ORDER BY DateTaken) AS SessionNum, DateTaken, (MAX(ClientData.TimeStamp) - MIN(ClientData.TimeStamp)) AS Duration 
  FROM ClientsSessions INNER JOIN ClientData ON ClientsSessions.SessionIndex=ClientData.SessionIndex
  WHERE ClientIndex = indexIn 
  ORDER BY SessionNum DESC;
END ;;
